import React from 'react'
import DynamicList from './DynamicList.js'
import {songs} from './testdata.js'


const Home= () => {
  return (
    <div className="container mx-auto p-4 bg-black w-full h-full">
      <DynamicList song_list={songs}/>
    </div>
  )
};

export default Home;
